// client/src/components/InputPanel.jsx
import React, { useState } from "react";
import { updateSensor } from "../api/sensors";
import "./InputPanel.css";

export default function InputPanel() {
  const [altitude, setAltitude] = useState("");
  const [his, setHis] = useState("");
  const [adi, setAdi] = useState("");

  const handleSend = () => {
    if (altitude !== "") updateSensor("altitude", Number(altitude));
    if (his !== "") updateSensor("his", Number(his));
    if (adi !== "") updateSensor("adi", Number(adi));
    alert("Values updated!");
  };

  return (
    <div className="input-panel">
      <div>
        <label>Altitude</label>
        <input type="number" value={altitude} onChange={(e) => setAltitude(e.target.value)} />
      </div>
      <div>
        <label>HIS</label>
        <input type="number" value={his} onChange={(e) => setHis(e.target.value)} />
      </div>
      <div>
        <label>ADI</label>
        <input type="number" value={adi} onChange={(e) => setAdi(e.target.value)} />
      </div>
      <button onClick={handleSend}>SEND</button>
    </div>
  );
}
